const form = document.querySelector("#p_form");

let item = form.querySelector("input");
const data = document.querySelector("#text_p");
let sedond_row = document.querySelector("#sedond_row");
let btn = document.querySelector("#copy_btn");

const get_paragraph = (e) =>{
    e.preventDefault();
    if(isNaN(item.value) || item.value < 0 || item.value > 50 || item.value == ""){
        const random = Math.floor(Math.random() * 50);
        sedond_row.style.display = "flex";
        data.innerHTML = text[random];
    }else{
        let  random1;
        let p = ``;
        sedond_row.style.display = "flex";
        for(let i = 0; i < item.value ; i++){
            random1 = Math.floor(Math.random() * text.length);
            p += `
                <p> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ${text[random1]}</p><br>
            `;
        }
        data.innerHTML = p;

    }
}
form.addEventListener("submit",get_paragraph); 

btn.addEventListener("click",function(){    
    navigator.clipboard.writeText(data.innerText);
})